Und ein bisschen Java:

```java
	//Version von Ordner und Spiel identisch?
	//	VersionFile laden
	File version = new File( pfad + "/Game.version" );
	//	Datei vorhanden?
	if( version.isFile() ){

		//Version aus Ordner lesen
		//	Scanner oeffnen
		Scanner versionInt = new Scanner( version );
		versionInt.useDelimiter( System.getProperty( "line.separator" ) );
		int ordnerVersion = Integer.parseInt( 
				versionInt.next()
			);
		versionInt.close();

		//Wenn Version unterschiedlich, neu schreiben
		if( ordnerVersion != this.version ){

			//schreibe Dateien in Ordner
			writeJSON();
			writeBinary();
			writeVersion();
		}
	}
	else if( !version.isFile() ){
		//schreibe Dateien in Ordner
		writeJSON();
		writeBinary();
		writeVersion();
	}

```

